import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Navbar extends Component {

    constructor(props){

        super(props);

        let navitems = [
            {
                name: "Home",
                url : "/"
            },
            {
                name: "Login",
                url : "/login"
            },
            {
                name: "Signup",
                url : "/signup"
            },
            {
                name: "Profile",
                url : "/profile"
            }, 
            {
                name: "Logout",
                url : "/logout"
            }, 
        ]

    }

    render() {
        return (
            <div>
                <ul>
                    {this.NavItems}
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/login">Login</Link>
                    </li>
                    <li>
                        <Link to="/signup">Signup</Link>
                    </li>
                </ul>

                <hr />

            </div>
        );
    }
}

export default Navbar;
